      body: '\n                   \n\nFrontend\nThis project was generated with Angular CLI version 17.3.1.\nDevelopment server\nRun ng serve for a dev server. Navigate to http://localhost:4200/. The application will automatically reload if you change any of the source files.\nCode scaffolding\nRun ng generate component component-name to generate a new component. You can also use ng generate directive|pipe|service|class|guard|interface|enum|module.\nBuild\nRun ng build to build the project. The build artifacts will be stored in the dist/ directory.\nRunning unit tests\nRun ng test to execute the unit tests via Karma.\nRunning end-to-end tests\nRun ng e2e to execute the end-to-end tests via a platform of your choice. To use this command, you need to first add a package that implements end-to-end testing capabilities.\nFurther help\nTo get more help on the Angular CLI use ng help or go check out the Angular CLI Overview and Command Reference page.\nMy Book Shelf\nMy Book Shelf is an Angular application designed to help users manage their book collections. The application allows users to register, log in, search for books, add books to favorites, and more.\nTable of Contents\n\nOverview\nFeatures\nInstallation\nUsage\nDocumentation\nContributing\nLicense\n\nOverview\nMy Book Shelf is an Angular application that allows users to manage their book collections, search for books, and view detailed information about books.\nFeatures\n\nUser registration and login\nEmail verification\nView book catalog\nSearch for books by title, author, or category\nView detailed book information\nElastic search\nAdd books to favorites\nLanguage switching\n\nAdvanced Features\n\nAdd, delete, edit user\'s own books\nRead books online\n\nAdditional Features\n\nDeploy the application on hosting (Heroku, Vercel)\nSet up CI/CD using GitHub Actions\nConfigure eslint, prettier, husky, etc.\n\nInstallation\n\nClone the repository:Example :git clone https://github.com/username/my-book-shelf.git\ncd my-book-shelf\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching ""\n        \n    \n    \n        No results matching ""\n    \n\n',
